import React from 'react'
import LoginBtnStyle from './login_btn.module.css'
const LoginBtn=()=>{
    return(
        <div >
        <a className={LoginBtnStyle.LoginBtn} href="#">
        Login
        </a>
        </div>
    )
}

export default LoginBtn
